fn mapping_utf8(ans: &mut Vec<u8>, value: u16) {
    let hi = TO_UTF8_HI[(value >> 6) as usize];
    let group = get_cp932_to_utf8(hi);

    let lw = (value & 0x3f) as u8;
    let mut lf = 0;
    let mut rt = group.len() - 1;
    while lf <= rt {
        let mid = lf + ((rt - lf) >> 2);
        if group[mid].0 == lw {
            let v = group[mid].1 as u32;

            if v < 0x80 {
                ans.push(v as u8);
            }
            else if v < 0x800 {
                ans.push(0xc0 + (v >> 6) as u8);
                ans.push(0x80 + (v & 0x3f) as u8);
            }
            else if v < 0x10000 {
                ans.push(0xe0 + (v >> 12) as u8);
                ans.push(0x80 + (v >> 6 & 0x3f) as u8);
                ans.push(0x80 + (v & 0x3f) as u8);
            }
            else if v < 0x200000 {
                ans.push(0xf0 + (v >> 18) as u8);
                ans.push(0x80 + (v >> 12 & 0x3f) as u8);
                ans.push(0x80 + (v >> 6 & 0x3f) as u8);
                ans.push(0x80 + (v & 0x3f) as u8);
            }
            else if v < 0x4000000 {
                ans.push(0xf8 + (v >> 24) as u8);
                ans.push(0x80 + (v >> 18 & 0x3f) as u8);
                ans.push(0x80 + (v >> 12 & 0x3f) as u8);
                ans.push(0x80 + (v >> 6 & 0x3f) as u8);
                ans.push(0x80 + (v & 0x3f) as u8);
            }
            else {
                ans.push(0xfc + (v >> 30) as u8);
                ans.push(0x80 + (v >> 24 & 0x3f) as u8);
                ans.push(0x80 + (v >> 18 & 0x3f) as u8);
                ans.push(0x80 + (v >> 12 & 0x3f) as u8);
                ans.push(0x80 + (v >> 6 & 0x3f) as u8);
                ans.push(0x80 + (v & 0x3f) as u8);
            }
            break;
        }
        else if group[mid].0 < lw {
            lf = mid + 1;
        }
        else {
            rt = mid - 1;
        }
    }
}

pub fn convert(source: Vec<u8>) -> Result<String, FromUtf8Error> {
    let ptr = source.as_ptr();
    let mut ans: Vec<u8> = Vec::new();

    let mut i: isize = 0;
    unsafe {
        while i < source.len() as isize {
            let c = *ptr.offset(i);
            if (c & 0x80) == 0 {
                ans.push(c);
                i += 1;
            }
            else {
                let v = c as u16 * 256 + *ptr.offset(i + 1) as u16;
                mapping_utf8(&mut ans, v);
                i += 2;
            }    
        }
    }

    String::from_utf8(ans)
}